import React from 'react'
import { Link } from 'react-router-dom'

class PetCard extends React.Component{
    render(){
        return(
            <div>
                <header className='header'>
                    <h2>Кличка питомца</h2>
                    <Link to='/PetSettings'><img src='https://e7.pngegg.com/pngimages/191/325/png-clipart-computer-icons-others-miscellaneous-%D0%B8%D0%BA%D0%BE%D0%BD%D0%BA%D0%B8-thumbnail.png' alt='Settings' /></Link>
                </header>
            </div>
        )
    }
}
